import React, { useState } from "react";
import '../components/css/profile.css'

const Profile=()=>{
    const [name,setName]= useState(null);
    const [email,setEmail]= useState(null);
React.useEffect(() => {
    fetch("/getuser")
      .then((res) => res.json())
      .then((data) => {
          setName(data.username);
          setEmail(data.email);
      });
  }, []);
  return(
    <main>
	<div id="float-background" className="argyle" ></div>
	<div id="user-card">
		<div id="user-content">
			<div id="user-general">
				<div id="user-picture">
					<img id="user-picture-img" src="https://www.kindpng.com/picc/m/495-4952535_create-digital-profile-icon-blue-user-profile-icon.png" alt="picture"/>
				</div>
				<div id="user-infos">
					<label id="user-infos-firstname">{name}</label>
					
					<p id="user-infos-location">{email}</p>
				</div>
			
			</div>
		</div>
	</div>
</main>
  );

}
export default Profile;
